#Declare Functions
Function Check-RunAsAdministrator(){
  #Get current user context
  $CurrentUser = New-Object Security.Principal.WindowsPrincipal $([Security.Principal.WindowsIdentity]::GetCurrent())
  
  #Check user is running the script is member of Administrator Group
  if($CurrentUser.IsInRole([Security.Principal.WindowsBuiltinRole]::Administrator))
  {
       Write-host "Script is running with Administrator privileges!" -ForegroundColor Green
  }
  else
    {
       #Create a new Elevated process to Start PowerShell
       $ElevatedProcess = New-Object System.Diagnostics.ProcessStartInfo "PowerShell";
 
       # Specify the current script path and name as a parameter
       $ElevatedProcess.Arguments = "& '" + $script:MyInvocation.MyCommand.Path + "'"
 
       #Set the Process to elevated
       $ElevatedProcess.Verb = "runas"
 
       #Start the new elevated process
       [System.Diagnostics.Process]::Start($ElevatedProcess)
 
       #Exit from the current, unelevated, process
       Exit
 
    }
}
function Update-RegistryKeys {
    param (
        [array]$Keys
    )
    Write-Host "Checking Registry Key Path and Value`n" -ForegroundColor Yellow
    $i = 1
    foreach ($Key in $Keys) {
        "Key #$i."
        $keyTest = Test-Path -Path "$($Key.keyPath)\$($Key.keyName)"
        
        if (-not $keyTest) {
            Write-Warning "$($Key.keyName) does not exist. Writing $($Key.keyName) to $($Key.keyPath) with value $($Key.keyValue)`n"
            New-Item -Path "$($Key.keyPath)" -Name "$($Key.keyName)" -Value "$($Key.keyValue)" -ErrorAction SilentlyContinue | Out-Null
        }
        else {
        Write-Host @"
            Updating Key:
            Key Name: $($Key.keyName)
            Key Path: $($Key.keyPath)
            Key Value: $($Key.keyValue)`n
"@ -ForegroundColor Green
            Set-ItemProperty -Path "$($Key.keyPath)" -Name "$($Key.keyName)" -Value "$($Key.keyValue)" -ErrorAction SilentlyContinue | Out-null
        }
    $i++
    }
}

function Create-Files {
    param (
        [array]$Files
    )

    foreach ($File in $Files) {
        "Creating $($File.Name) in C:\SAP"
        $content = [Convert]::FromBase64String($File.Value)
        Set-Content -Path "C:\SAP\$($File.Name)" -Value $content -Encoding Byte
    }
}
function Check-FileHash {
    param (
        [array]$Files
    )

    foreach ($file in $Files) {
        $getHash = Get-FileHash -Path $file.Path
        "$($file.file) hash is $($getHash.hash), encrypted with $($getHash.Algorithm)`n"
        
        if ($getHash.hash -eq $file.hash) {
            Write-Host -ForegroundColor Green "$([char]0x1b)[92m$([char]8730) $($file.file) hash matches the hash table`n"
            start-sleep 1
        } else {
            Write-Warning "$($file.file) hash is incorrect, recreating the file and re-checking"
            $recreate = $Files | Where-Object { $_.file -eq $file.file }
            Remove-Item $file.Path
            "Re-creating $($file.file) from base64 string"
            $newContent = [System.Convert]::FromBase64String($recreate.Value)
            Set-Content -Path $file.Path -Value $newContent -Encoding Byte
        }
    }
}
